import React from 'react';
import './App.css';

function App() {
  handleClick = () => {
    console.log('click');
  }

  return (
    <div className="App">
      <input type="text" name="input"/>
      <button name="Button" onClick={this.handleClick}>GO!</button>
    </div>
  );
}

export default App;
